    true,nt"url": null,nt"notes": "<p>CMS has released new information on Qualified
    Health Plan selections by county for the 37 states that use the HealthCare.gov platform
    (including the Federally-facilitated Marketplace, State Partnership Marketplaces
    and supported State-based Marketplaces) for the Marketplace open enrollment period
    from November 15, 2014 through February 15, 2015, including additional special enrollment
    period (SEP) activity reported through February 22, 2015.  The data represent the
    number of unique individuals who have been determined eligible to enroll in a Qualified
    Health Plan and had selected a Marketplace plan by February 15, 2015 (including
    SEP activity through February 22).</p>n",nt"license_title": "Other License
